import { Link } from "react-router-dom";
import 'bootstrap/dist/css/bootstrap.min.css';
import './nav.css'

import React, { useState } from 'react';

const Nava = () => {
  const [showSubMenu, setShowSubMenu] = useState(false);

  const showSubMenuHandler = (element) => {
    const submenu = element.querySelector('.submenu');
    if (submenu) {
      submenu.classList.add('show');
    }
  };

  const hideSubMenuHandler = (element) => {
    const submenu = element.querySelector('.submenu');
    if (submenu) {
      submenu.classList.remove('show');
    }
  };

  return (
    <div>
      <div
        style={{
          backgroundColor: '#00B0F6',
          width: '100%',
          height: '40px',
          fontSize: '25px',
          color: '#ffffff',
        }}
        className="d-flex flex-wrap align-items-center justify-content-center justify-content-md-between border-bottom fixed-top"
      >
        Unidad Familia Medellin
      </div>

      <div
        style={{
          backgroundColor: '#ffffff',
          opacity: 1,
          marginTop: '39px !important',
          fontSize: '18px',
        }}
        className="d-flex flex-wrap align-items-center justify-content-center justify-content-md-between border-bottom fixed-top"
      >
        <div className="col-md-3 mb-2 mb-md-0">
          <img
            style={{ paddingLeft: '30px' }}
            width="150"
            height="100"
            role="img"
            src="https://cdnwordpresstest-f0ekdgevcngegudb.z01.azurefd.net/es/wp-content/uploads/2022/03/Open-Graph-.png"
            alt=""
          />
          <a href="/" className="d-inline-flex link-body-emphasis text-decoration-none"></a>
        </div>

        <nav className="nav col-md-4 mb-2 justify-content-center mb-md-0">
          <ul className="nav">
            <li>
              <div
                className="menu-item"
                onMouseOver={(e) => showSubMenuHandler(e.target)}
                onMouseLeave={(e) => hideSubMenuHandler(e.target)}
              >
                <a href="./" className="nav-link px-2 ">
                  Inicio
                </a>
              </div>
            </li>
            <li>
              <div
                className="menu-item"
                onMouseOver={(e) => showSubMenuHandler(e.target)}
                onMouseLeave={(e) => hideSubMenuHandler(e.target)}
              >
                <a href="#" className="nav-link px-2">
                  ¿Quienes somos?
                </a>
                <div className={`submenu text-center ${showSubMenu ? 'show' : ''}`}>
                  <label className="liT mb-2 ">
                    <a className="sub liT" href="/contactenos">
                      &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Contactenos&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;{' '}
                    </a>
                  </label>
                  <br />
                  <label className="liT">
                    <a className="sub liT" href="/ufm">
                      &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Unidad Familia&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
                    </a>
                  </label>
                </div>
              </div>
            </li>
            <li>
              <div
                className="menu-item"
                onMouseOver={(e) => showSubMenuHandler(e.target)}
                onMouseLeave={(e) => hideSubMenuHandler(e.target)}
              >
                <a href="#" className="nav-link px-2">
                  Noticias
                </a>
                <div className={`submenu text-center ${showSubMenu ? 'show' : ''}`}>
                  <label className="liT mb-2 ">
                    <a className="sub liT" href="#">
                      &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Contactenos&nbsp;&nbsp;&nbsp;&nbsp;{' '}
                    </a>
                  </label>
                  <br />
                  <label className="liT">
                    <a className="sub liT" href="#">
                      &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;SIOF&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
                    </a>
                  </label>
                </div>
              </div>
            </li>
            <li>
              <div
                className="menu-item"
                onMouseOver={(e) => showSubMenuHandler(e.target)}
                onMouseLeave={(e) => hideSubMenuHandler(e.target)}
              >
                <a href="#" className="nav-link px-2">
                  Multimedia
                </a>
              </div>
            </li>
          </ul>
        </nav>

        <div className="col-md-3 text-end">
          <button
            type="button"
            style={{ border: '1px solid #00B0F6 !important', color: '#00B0F6 !important' }}
            className="btn me-2 login"
          >
            Login UFM
          </button>
          <button
            type="button"
            style={{ border: '1px solid #00B0F6 !important', background: '#00B0F6 !important' }}
            className="btn btn-primary"
          >
            Login Admin
          </button>
        </div>
      </div>
    </div>
  );
};

export {Nava};
